function convertDateFormat(dateStr) {
  // Split the input date string by '/'
  const [month, day, year] = dateStr.split('/');

  // Create a new Date object from the extracted components
  const date = new Date(year, month - 1, day);

  // Format the date in YYYY-MM-DD
  //const formattedDate = date.toISOString().split('T')[0];
  const formattedDate = `${date.getFullYear()}-${String(date.getMonth() + 1).padStart(2, '0')}-${String(date.getDate()).padStart(2, '0')}`;

  return formattedDate;
}
/**
 * Check if the image is horizontal and rotate if it is.
 * @param {string} base64Image - The base64 string of the image.
 * @param {number} rotateDegrees - The degrees to rotate the image if it is horizontal.
 * @returns {Promise<string>} - A promise that resolves to the base64 string of the processed image.
 */
async function rotateBase64ImageIfHorizontal(base64Image, rotateDegrees) {
  try {
    const imageBuffer = Buffer.from(base64Image, 'base64');
    const image = sharp(imageBuffer);
    const metadata = await image.metadata();

    // Check if the image is horizontal
    if (metadata.width > metadata.height) {
      const rotatedImageBuffer = await image.rotate(rotateDegrees).toBuffer();
      return rotatedImageBuffer.toString('base64');
    }

    // Return the original base64 image if it is not horizontal
    return base64Image;
  } catch (error) {
    console.error('Error processing image:', error);
    throw error;
  }
}
